let width=window.innerWidth/100;
let height=window.innerHeight/100
export const res2={
    stats:{
        image:function(image)
        {
            let style={
                width:`${10*width}px`,
                height:`${20*height}px`,
                position:'relative',
                top:`${20*height}px`,
                left:`${10*width}px`,
                backgroundImage:`url(${image})`,
                backgroundSize:`${10*width}px ${20*height}px`,
            }
            return style;
        },
        leaderboard:function(){
            let style={
               position:'relative',
               top:`${5*height}px`,
               left:`${20*width}px`,
               width:`${60*width}px`,
               border:`${Math.min(0.1*height,0.1*width)}px solid grey`
            }
            return style;
        },
        header:function(){
            let style={
                height:`${10*height}px`,
                width:`${60*width}px`,
                position:"relative",
            }
            return style;
        },
        heading:function(){
            let style={
                top:`${5*height}px`,
                color:'white',
                left:`${40*width}px`,
                position:"relative",
                margin:`${5*height}px`
            }
            return style;
        }
    }
}
